import './Navbar.css';
import React,{useState,useEffect} from 'react';
import {Form,InputGroup} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Navbar(props) {

    useEffect(()=>{
            console.log(props);
        },[props]);

    return (
        
        <div>
            <InputGroup className="mb-3">
            <InputGroup.Text id="basic-addon1">{props.valore1}</InputGroup.Text>
                <Form.Control
                placeholder={props.valore2}
                aria-label="Username"
                aria-describedby="basic-addon1"
                onChange={(event)=>props.funzione(event.target.value)}
                />
            </InputGroup>
        </div>
    )
}

export default Navbar
